import React from "react";
import { Paper, List, ListItem, ListItemText } from "@material-ui/core";

function TodoList(props) {
  return (
    <Paper>
      <List>
        {props.todos.map(todo => (
          <ListItem>
            <ListItemText>{todo.task}</ListItemText>
          </ListItem>
        ))}
      </List>
    </Paper>
  );
}

export default TodoList;
